Yシャツなら2列で並べて1段に8枚収納！<br>
リビングの収納にピッタリの木天板付きチェストです♪<br>
木天板は汚れに強く、前板は塗装家具のような質感でおしゃれなデザインです。<br>
また、引出しには開閉がスムーズな金属レールを採用しました。<br>
Yシャツを2枚並べて収納できる幅56cmタイプです。<br>
<font color=red>※完成品でお届けします。<br>※上段を下段に重ねる作業のみ必要です。</font><br>
